webpackJsonp([36545164762560],{623:function(a,t){a.exports={data:{markdownRemark:{html:'<h3>Publishing External Vulnerabilities</h3>\n<p>We now enable hackers to publish their findings from external sources that don\'t have HackerOne programs. Click <a href="/hackers/publishing-external-vulnerabilities.html">here</a> to learn more.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/aug-2018-hacktivity++-3622eb9ce2388c7e2d0bdb0a1553a162-7aa8f.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 19.269521410579344%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="aug-2018-publishing"\n        title=""\n        src="/static/aug-2018-hacktivity++-3622eb9ce2388c7e2d0bdb0a1553a162-e7ffa.png"\n        srcset="/static/aug-2018-hacktivity++-3622eb9ce2388c7e2d0bdb0a1553a162-49813.png 125w,\n/static/aug-2018-hacktivity++-3622eb9ce2388c7e2d0bdb0a1553a162-dc8a5.png 250w,\n/static/aug-2018-hacktivity++-3622eb9ce2388c7e2d0bdb0a1553a162-e7ffa.png 500w,\n/static/aug-2018-hacktivity++-3622eb9ce2388c7e2d0bdb0a1553a162-dda24.png 750w,\n/static/aug-2018-hacktivity++-3622eb9ce2388c7e2d0bdb0a1553a162-c5f18.png 1000w,\n/static/aug-2018-hacktivity++-3622eb9ce2388c7e2d0bdb0a1553a162-22484.png 1500w,\n/static/aug-2018-hacktivity++-3622eb9ce2388c7e2d0bdb0a1553a162-7aa8f.png 1588w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Two-Factor Authentication</h3>\n<p>Hackers now have the ability to set up <a href="/hackers/two-factor-authentication.html">two-factor authentication</a> to add an extra layer of protection to their accounts.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/aug-2018-2fa-393bda29b58884686454fd1bf7779514-06008.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 402px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 93.78109452736318%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="aug-2018-2fa"\n        title=""\n        src="/static/aug-2018-2fa-393bda29b58884686454fd1bf7779514-892de.png"\n        srcset="/static/aug-2018-2fa-393bda29b58884686454fd1bf7779514-14e20.png 125w,\n/static/aug-2018-2fa-393bda29b58884686454fd1bf7779514-13201.png 250w,\n/static/aug-2018-2fa-393bda29b58884686454fd1bf7779514-892de.png 500w,\n/static/aug-2018-2fa-393bda29b58884686454fd1bf7779514-a9175.png 750w,\n/static/aug-2018-2fa-393bda29b58884686454fd1bf7779514-06008.png 804w"\n        sizes="(max-width: 402px) 100vw, 402px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Inbox Filters</h3>\n<p>Programs can now filter reports with these new inbox filters:</p>\n<ul>\n<li>No weakness</li>\n<li>No asset</li>\n<li>With references</li>\n<li>Without references\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/aug-2018-inbox-filters-cd43a64434a24c428650cc556c1a12f1-a51a1.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 255px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 160.39215686274508%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="aug-2018-inbox-filters"\n        title=""\n        src="/static/aug-2018-inbox-filters-cd43a64434a24c428650cc556c1a12f1-79a31.png"\n        srcset="/static/aug-2018-inbox-filters-cd43a64434a24c428650cc556c1a12f1-f4e59.png 125w,\n/static/aug-2018-inbox-filters-cd43a64434a24c428650cc556c1a12f1-777a2.png 250w,\n/static/aug-2018-inbox-filters-cd43a64434a24c428650cc556c1a12f1-79a31.png 500w,\n/static/aug-2018-inbox-filters-cd43a64434a24c428650cc556c1a12f1-a51a1.png 510w"\n        sizes="(max-width: 255px) 100vw, 255px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </li>\n</ul>\n<h3>Insights (beta)</h3>\n<p>We introduce the insights page to provide hackers with helpful statistics about programs they\'re contemplating to hack on. The  information is provided to help hackers focus their efforts on the right assets for the right programs. Categories of insights include:</p>\n<ul>\n<li>Bounties</li>\n<li>Reports</li>\n<li>Hacker Participation</li>\n<li>Top 10 vulnerabilities</li>\n<li>Scope Severities\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/aug-2018-insights-869532eea7ad4c11586fcfd6c58ada82-f111a.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.745164960182024%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="insights"\n        title=""\n        src="/static/aug-2018-insights-869532eea7ad4c11586fcfd6c58ada82-e7ffa.png"\n        srcset="/static/aug-2018-insights-869532eea7ad4c11586fcfd6c58ada82-49813.png 125w,\n/static/aug-2018-insights-869532eea7ad4c11586fcfd6c58ada82-dc8a5.png 250w,\n/static/aug-2018-insights-869532eea7ad4c11586fcfd6c58ada82-e7ffa.png 500w,\n/static/aug-2018-insights-869532eea7ad4c11586fcfd6c58ada82-dda24.png 750w,\n/static/aug-2018-insights-869532eea7ad4c11586fcfd6c58ada82-c5f18.png 1000w,\n/static/aug-2018-insights-869532eea7ad4c11586fcfd6c58ada82-22484.png 1500w,\n/static/aug-2018-insights-869532eea7ad4c11586fcfd6c58ada82-f111a.png 1758w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </li>\n</ul>',frontmatter:{path:"/changelog/2018/august",title:"August 2018"}}},pathContext:{}}}});
